import React from "react";
export default class Classe extends React.Component{
    constructor(props){
        super(props)
        this.modelo = 'HRV'
        this.estado={
            ligado:false,
            velocidade:0,
        }
    }
    ligado=()=>{
        this.setState.ligado=true
    }

    render(){
        return(
            <div>
                <h1>Meu Carro</h1>
                <p>Modelo: {this.modelo}</p>
                <p>Estado: {this.estado.ligado?"ligado":"desligado"}</p>
                <p>Velocidade: {this.estado.velocidade}</p>
                <button onClick={this.ligado}>Ligar Carro</button>
            </div>
        )
    }
}
